import React from 'react';
import AWS_ICONS from '../config/aws-icons';

const AWSArchitectureDisplay = ({ architecture, missingServices, onServiceClick }) => {
  console.log('Rendering AWSArchitectureDisplay with:', { architecture, missingServices });

  if (!architecture || !architecture.services) {
    return (
      <div className="architecture-container">
        <div className="loading-state">Loading Architecture...</div>
      </div>
    );
  }

  return (
    <div className="architecture-container">
      <div className="architecture-diagram">
        {architecture.services.map((service) => (
          <div 
            key={service.id}
            className={`service-node ${missingServices?.includes(service.id) ? 'missing' : ''}`}
            style={{
              margin: '10px',
              padding: '10px',
              display: 'inline-block'
            }}
          >
            <img 
              src={service.icon}
              alt={service.name}
              style={{ width: '48px', height: '48px' }}
            />
            <div style={{ color: 'white' }}>{service.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AWSArchitectureDisplay;
